import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { FaCar, FaSprayCan, FaBroom, FaShieldAlt, FaPhone, FaEnvelope, FaMapMarkerAlt } from 'react-icons/fa';
import { Link } from 'react-router-dom';

const AboutPage = () => {
  const [activeSection, setActiveSection] = useState('home');

  return (
    <div className="bg-black text-white min-h-screen">
      <Navbar activeSection={activeSection} setActiveSection={setActiveSection} />
      <main>
        {activeSection === 'home' && <Hero />}
        {activeSection === 'services' && <Services />}
        {activeSection === 'gallery' && <Gallery />}
        {activeSection === 'contact' && <Contact />}
      </main>
    </div>
  );
};

const Navbar = ({ activeSection, setActiveSection }) => {
  return (
    <nav className="fixed top-0 left-0 right-0 bg-black bg-opacity-50 z-50">
      <div className="container mx-auto px-4 py-4 flex justify-between items-center">
        <Link to="/" className="text-2xl font-light">JR Auto Detailing</Link>
        <div className="flex space-x-6">
          {['home', 'services', 'gallery', 'contact'].map((section) => (
            <button
              key={section}
              className={`text-sm uppercase tracking-wide hover:text-gray-300 ${activeSection === section ? 'text-white' : 'text-gray-500'}`}
              onClick={() => setActiveSection(section)}
            >
              {section}
            </button>
          ))}
        </div>
      </div>
    </nav>
  );
};

const Hero = () => {
  return (
    <div className="relative h-screen flex items-center justify-center">
      <div className="absolute inset-0 bg-gradient-to-r from-black to-transparent" />
      <div className="relative z-10 text-left max-w-3xl mx-auto px-4">
        <motion.h1 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.5, duration: 0.8 }}
          className="text-6xl font-light mb-4"
        >
          Elevate Your Drive
        </motion.h1>
        <motion.p
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.7, duration: 0.8 }}
          className="text-xl mb-8"
        >
          Experience premium auto detailing that transforms your vehicle
        </motion.p>
        <motion.button
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
          className="bg-white text-black px-8 py-3 rounded-full text-sm font-semibold uppercase tracking-wide"
        >
          Book Now
        </motion.button>
      </div>
    </div>
  );
};

const Services = () => {
  const services = [
    { icon: <FaCar />, title: "Full Detailing", description: "Comprehensive interior and exterior detailing for a showroom-fresh look." },
    { icon: <FaSprayCan />, title: "Exterior Washing", description: "Gentle yet thorough exterior cleaning to protect your vehicle's paint." },
    { icon: <FaBroom />, title: "Interior Cleaning", description: "Deep cleaning of all interior surfaces, leaving your car fresh and pristine." },
    { icon: <FaShieldAlt />, title: "Paint Protection", description: "Advanced ceramic coating to shield your car's paint from environmental damage." },
  ];

  return (
    <section className="py-20 mt-16">
      <div className="container mx-auto px-4">
        <h2 className="text-3xl font-light mb-12 text-center">Our Services</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8">
          {services.map((service, index) => (
            <ServiceCard key={index} {...service} />
          ))}
        </div>
      </div>
    </section>
  );
};

const ServiceCard = ({ icon, title, description }) => (
  <motion.div 
    whileHover={{ scale: 1.05 }}
    className="bg-gray-900 p-6 rounded-lg"
  >
    <div className="text-4xl mb-4 text-white">{icon}</div>
    <h3 className="text-xl font-semibold mb-2">{title}</h3>
    <p className="text-sm text-gray-400">{description}</p>
  </motion.div>
);

const Gallery = () => {
  // Add your gallery implementation here
  return (
    <section className="py-20 mt-16">
      <div className="container mx-auto px-4">
        <h2 className="text-3xl font-light mb-12 text-center">Our Work</h2>
        {/* Add your gallery content here */}
      </div>
    </section>
  );
};

const Contact = () => (
  <section className="py-20 mt-16">
    <div className="container mx-auto px-4">
      <h2 className="text-3xl font-light mb-12 text-center">Contact Us</h2>
      <div className="flex flex-col md:flex-row justify-center space-y-8 md:space-y-0 md:space-x-8">
        <ContactInfo icon={<FaPhone />} text="+1 (604) 123-4567" />
        <ContactInfo icon={<FaEnvelope />} text="info@jrautodetailing.com" />
        <ContactInfo icon={<FaMapMarkerAlt />} text="123 Auto Street, Surrey, BC" />
      </div>
    </div>
  </section>
);

const ContactInfo = ({ icon, text }) => (
  <div className="flex items-center">
    <div className="text-2xl text-white mr-4">{icon}</div>
    <p className="text-sm">{text}</p>
  </div>
);

export default AboutPage;
